import React from "react";

function Error() {
  return (
    <div>
      <img
        style={{ width: "60%", margin: " 80px auto" }}
        src="https://graphicriver.img.customer.envatousercontent.com/files/266832291/590x393px.jpg?auto=compress%2Cformat&q=80&fit=crop&crop=top&max-h=8000&max-w=590&s=4268063ccd275c48f7deaf4da8ad8c1e"
        alt="error404"
      />
    </div>
  );
}

export default Error;
